join usuario u on m.idUsuario=u.idUsuario
join estados e on m.est=e.idestados
where concat(a.dni,a.nomb,a.apepa,a.apema) like concat('%',bus,'%')  and m.idAnioEscolar=anio and m.idGrado=grad and m.idSeccion=secc order by concat(a.apepa,' ',a.apema,' ',a.nomb) asc ;
END$$

